import { Link } from "react-router-dom";
import EventsNavigation from "./EventsNavigation";


const EventsPage = () => {

  const DUMMYEVENTS = [
    {
      id: 1,
      title: 'React Workshop',
      date: '2023-05-15',
      location: 'New York City',
      description: 'A workshop on building React applications',
    },
    {
      id: 2,
      title: 'JavaScript Conference',
      date: '2023-06-10',
      location: 'San Francisco',
      description: 'A conference focused on JavaScript and web development',
    },
    {
      id: 3,
      title: 'UI/UX Design Summit',
      date: '2023-07-22',
      location: 'London',
      description: 'A summit for UI/UX designers to share knowledge and experiences',
    },
    // Add more event objects as needed
  ];

  const eventXml = DUMMYEVENTS.map((event) =>
    <ul key={event.id}>
      <Link to={`/events/${event.id}`}>{event.title}</Link>
      <ul>{event.date}</ul>
      <ul>{event.location}</ul>
      <ul>{event.description}</ul>
    </ul>
  )

  return (
    <>
    <EventsNavigation/>
      <h1>Events Page</h1>
      {eventXml}
    </>
  )
}

export default EventsPage
